import React from "react";

const ToDoApp = () => {
  return (
    <>
      <div className="center_div">
        <h1>ToDoApp</h1><br/>
        <input type="text" placeholder="Add an Item" />
        <br />
        <br />
        <IconButton aria-label="delete">
        <DeleteIcon />
      </IconButton>
      </div>
    </>
  );
};
export default ToDoApp;
